import React, { Component } from "react";
import PropTypes from 'prop-types';
class Error extends Component {
  render() {
    return <div>
        <h1>Error{this.props.code}</h1>
    </div>;
  }
}

Error.propTypes = {
    code: PropTypes.number.isRequired
};

export default Error;
